function App() {
  return (
    <div className="min-h-screen bg-green-500 flex items-center justify-center">
      <div className="bg-white p-8 rounded-lg shadow-md">
        <h1 className="text-4xl font-bold text-blue-600 mb-4 bg-green-300">Hello, World!</h1>
        <p className="text-black-700">Welcome to your React.js app with Tailwind CSS</p>
      </div>
      <Itemdesc/>
    </div>
  );
}

export default App;
